const primaryNav=document.querySelector("#primary-navigation"),navToggle=document.querySelector("#mobile-nav-toggle");navToggle.addEventListener("click",()=>{var e=primaryNav.getAttribute("data-visible");"false"===e?(primaryNav.setAttribute("data-visible",!0),navToggle.setAttribute("aria-expanded",!0)):"true"===e&&(primaryNav.setAttribute("data-visible",!1),navToggle.setAttribute("aria-expanded",!1))});